import React from 'react'
import './Sidebar.css';
import Logo from '../../imgs/logo.png'

export const Sidebar = () => {
    return (
        <div className='Sidebar'>
            <div className='logo'>
                <img src={Logo} alt="" />
                <span>Sh<span>op</span>s</span>
            </div>
            /* Menu */

            <div className='menu'>
                <div className='menuItem'>
                    <div>Icon</div>
                    <span>Dash</span>
                </div>

            </div>


        </div>





    )
}
